  test("commit test") {

    val conn = adminConn()
    val table = root / "test"

    Try {
      val lo = conn.commitTime > 0L
      val hi = conn.commitTime > 0L

      conn.commit(0L, 100L, table) match {
        case (Some(lo_), Some(hi_)) =>
          assert(lo_ == lo)
          assert(hi_ == hi)
        case (Some(lo_), None) =>
          assert(lo_ == lo)
        case (None, Some(hi_)) =>
          assert(hi_ == hi)
        case (None, None) =>
          assert(false)
      }
      conn.commit(lo + 1L, hi - 1L, table) match {
        case (Some(lo_), Some(hi_)) =>
          assert(lo_ == lo)
          assert(hi_ == (hi - 1L))
        case (Some(lo_), None) =>
          assert(lo_ == lo)
        case (None, Some(hi_)) =>
          assert(hi_ == (hi - 1))
        case (None, None) =>
          assert(false)
      }
    }
  }


  def put(conn: Connection, table: TableRef, row: Key)(implicit builder: (Array[Byte], Array[Byte], Boolean) => Content): Unit = {
    val key = row.toKey(table)
    val content = builder(null, null, true)
    val result = conn.put(table, key, content)
    if (result != ConnAutoCommit()) {
      fail("put returned " + result)
    }
  }

  def get(conn: Connection, table: TableRef, row: Key, content: Option[Content])(implicit builder: (Array[Byte], Array[Byte], Boolean) => Content): Unit = {
    val key = row.toKey(table)
    val option = getOption(conn, table, key)
    val violation = if (content.isEmpty) {
      option.isDefined
    } else {
      option.isEmpty || (option.get.value != content.get.value)
    }
    if (violation) {
      val got = if (option.isEmpty) {
        "null"
      } else {
        Bytes.toStringBinary(option.get.value)
      }
      val expected = if (content.isEmpty) {
        "null"
      } else {
        Bytes.toStringBinary(content.get.value)
      }
      fail(s"Expected $expected. Got $got. Option $option")
    }
  }

